import React from 'react';
import {Route, Routes} from "react-router-dom";
import {privateRoutes, publicRoutes} from "./listRoutes";

const AppRoutes = () => {
    const auth = false
    return (auth ?
            (
                <Routes>
                    {publicRoutes.map(pub => (
                        <Route path={pub.path} element={<pub.component/>}/>
                    ))}
                </Routes>
            )
                :
                (
                    <Routes></Routes>
                )
    );
};

export default AppRoutes;
